function printPDF() {
    var img = "data:image/png;base64,"
    var doc = new jsPDF();
    var elementHTML = $('#tour-schedule').html();
    var specialElementHandlers = {
        '#tour': function(element, renderer){
            return true;
        }
    };

    doc.addImage(img, 'JPEG', 15, 15, 20, 15)
    doc.fromHTML(elementHTML, 15, 30, {
        'width': 170,
        'elementHandlers': specialElementHandlers
    },    function(bla){doc.save('tour.pdf')
    
});
}
